import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import Button from "react-bootstrap/Button";
import { useEffect, useState } from "react";

const Dish = () => {
  const [url, setUrl] = useState("www.themealdb.com/api/json/v1/1/search.php?f=a");
  const[item, setItem] = useState();
  const[show, setShow] = useState(false);
  useEffect(() => {
    fetch(url)
      .then(response => response.json())
      .then(data=>{console.log(data.meals)
      setItem(data.meals);
      setShow(true);
    })
  }, [url]);

  return (
    <>
        <Card style={{ width: "18rem" }}>
          <Card.Img
            variant="top"
            src="https://www.themealdb.com/images/media/meals/wxywrq1468235067.jpg"
          />
          <Card.Body>
            <Card.Title>Apple Frangipan Tart</Card.Title>
            <Card.Text>{list.strArea}</Card.Text>
          </Card.Body>
          <ListGroup className="list-group-flush">
            <ListGroup.Item>Comment 1</ListGroup.Item>
            <ListGroup.Item>Comment 2</ListGroup.Item>
            <ListGroup.Item>Comment 3</ListGroup.Item>
          </ListGroup>
          <Card.Body>
            <Button variant="success">Comment</Button>
            <Button variant="success">Save</Button>
          </Card.Body>
        </Card>
    </>
  );
};

export default Dish;
